import React from 'react';
import { StyleSheet, Text, View, Button } from 'react-native';

const navigateToCategory = (props) => {
    props.navigation.navigate('Category');
};

const HomeScreen = (props) => {
    console.log(props);
    return (
        <SafeAreaView style={{ flex: 1, justifyContent: 'center', alignItems: 'center', backgroundColor: '#fff' }}>
            <View style={{ marginTop: 20 }}>
                <Text style={{ fontSize: 35, fontWeight: 'bold', color: '#491b32' }}>NAIL-SYS</Text>
            </View>
            <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
                <LogoNailsSys width={300} height={300} transform={[{ rotate: 0 }]} />
            </View>
            <TouchableOpacity
                activeOpacity={0.75}
                style={{
                    backgroundColor: '#eb4077',
                    width: '90%',
                    padding: 20,
                    borderRadius: 5,
                    flexDirection: 'row',
                    justifyContent: 'space-between',
                    marginBottom: 50,
                }}
            >
                <Text style={{ fontWeight: 'bold', fontSize: 18, color: '#fff', fontFamily: 'Roboto-MediumItalic' }}>Let's Begin</Text>
                <MaterialIcons name="arrow-forward-ios" size={22} color="#fff" />
            </TouchableOpacity>
        </SafeAreaView>
    );
};

const styles = StyleSheet.create({
    screen: {
        flex: 1,
    },
});

export default HomeScreen;
